  void handlePartnersList(List<dynamic> categories) {
    categories.forEach((categ) {
      categ.partnerInfos.forEach((partner) {
        partnersList.add(partner);
      });
    });
  }

  TextEditingController searchController = new TextEditingController();

  Widget _getRowTaps(var langType) {
    List<Widget> rowTapps = new List<Widget>();
    rowTapps.add
      (new GestureDetector(
        onTap: () {
          setState(() {
            filteredList = [];
            categoryListFromApi.forEach((category) {
              filteredList.addAll(category.partnerInfos);
              category.isActive = false;
            });
            activeId = 0;
          });
        },
        child: Column(
          children: <Widget>[
            Container(
                child: Text(langType == arabicLang ? "الكل" : "All",
                    style: TextStyle(
                      color: activeId == 0
                          ? activeTapColor
                          : Color.fromARGB(255, 169, 169, 176),
                      fontSize: 20,
                    )),
                decoration: activeId == 0
                    ? BoxDecoration(
                        border: Border(
                            bottom: BorderSide(
                                color: activeTapColor,
                                style: BorderStyle.solid,
                                width: 2.0)))
                    : BoxDecoration(border: null))
          ],
        )));
    rowTapps.add(Padding(padding: EdgeInsets.fromLTRB(20, 0, 0, 20)));
    categoryListFromApi.forEach((category) {
      rowTapps.add(new GestureDetector(
          onTap: () {
            setState(() {
              filteredList = [];
              filteredList.addAll(category.partnerInfos);
              activeId = category.id;
              categoryListFromApi.forEach((catego) {
                if (catego.id == activeId) {
                  catego.isActive = true;
                } else {
                  catego.isActive = false;
                }
              });
            });
          },
          child: Column(
            children: <Widget>[
              Container(
                  child: Text(
                      langType == arabicLang
                          ? category.arabicname
                          : category.arabicname,
                      style: TextStyle(
                        color: category.isActive
                            ? activeTapColor
                            : Color.fromARGB(255, 169, 169, 176),
                        fontSize: 20,
                      )),
                  decoration: category.isActive
                      ? BoxDecoration(
                          border: Border(
                              bottom: BorderSide(
                                  color: activeTapColor,
                                  style: BorderStyle.solid,
                                  width: 2.0,
                              )))
                      : BoxDecoration(border: null)),
            ],
          )));
      rowTapps.add(Padding(padding: EdgeInsets.fromLTRB(20, 0, 0, 20)));
    });

    return new ListView(
      children: rowTapps,
      scrollDirection: Axis.horizontal,
    );
  }

  onChangeSearch(String text) async {
    if (text.isEmpty) {
      setState(() {
        filteredList.clear();
        categoryListFromApi.forEach((category) {
          filteredList.addAll(category.partnerInfos);
        });
      });
      return;
    }
    filteredList.clear();
    filteredList = partnersList
        .where((category) =>
            (category.name.toLowerCase().contains(searchController.text) ||
                category.arabicname.toLowerCase().contains(searchController.text)))
        .toList();

    setState(() {});
  }

  bool isLoading = true;

  Future<VoidCallback> getAllCateg() async {
    var result = await LoyaltyNetwork().sendContextRequest(
        LoyaltyNetworkRequest(
            apiPath: LOYALTY_API.CATEGORY_INFOS,
            requestType: NETWORK_REQUEST_TYPE.GET),
        context);
    debugPrint("all is good");

    setState(() {
      isLoading = false;
      categoryListFromApi = Category.listFromJson(result);
      categoryListFromApi.forEach((category) {
        filteredList.addAll(category.partnerInfos);
        category.isActive = false;
        activeId = 0;
      });
    });

    handlePartnersList(categoryListFromApi);
  }

  @override
  void initState() {
    super.initState();
    getAllCateg();
  }

